              Account.findOne({ accountId })
                .then(account => {
                  const { accountId, balance, frozen } = account;
                  resolve({
                    accountId,
                    balance,
                    frozen
                  });
                })
                .catch(e => {
                  reject(errorObj("ACCOUNTS", "Unknown error"));
                });
            }
          });
        })
      );
    });

    return Promise.all(promises);
  }
}

const accountAPI = new AccountAPI();
export default accountAPI;

